import React from "react";
import Crossword from "@jaredreisinger/react-crossword";
import styled from "styled-components";

const data = {
  across: {
    1: {
      clue: "one plus one",
      answer: "TWO",
      row: 0,
      col: 0,
    },
    3: {
      clue: "five plus three",
      answer: "EIGHT",
      row: 2,
      col: 2,
    },
  },
  down: {
    2: {
      clue: "three minus two",
      answer: "ONE",
      row: 0,
      col: 2,
    },
  },
};

const Container = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: flex-start;
  margin: 20px;

  .crossword {
    margin-right: 20px;
  }

  .clues {
    max-width: 200px; /* Adjust to fit your design */
  }
`;

export default function UtakAtikGathukNglegena() {
  return (
    <div className="contain">
      <br />
      <h1 className="p-20 m-5 text-center">Utak Atik Gathuk Nglegena</h1>
      <br />
      <Container>
        <div className="crossword">
          <Crossword data={data} />
        </div>
        <div className="clues">
          <h3>Across</h3>
          <ul>
            <li>1: one plus one</li>
            <li>3: five plus three</li>
          </ul>
          <h3>Down</h3>
          <ul>
            <li>2: three minus two</li>
          </ul>
        </div>
      </Container>
    </div>
  );
}
